import React, {useState, useEffect} from 'react';
import Post from "./Post";
import NewPost from "./NewPost";
import axios from "axios";

const Feed = () => {

  const [data, setPost] = useState();

  const getPostsData = () => {
    axios
      .get('http://localhost:3002/posts') //THIS IS YOUR URL OF YOUR API
      .then((data) => setPost(data.data)) //PROMISE API, THAT MEANS WHEN YOU GET THE DATA WHAT DO I DO WITH IT
      .catch((error) => console.log(error));  //ERROR CATCHING IN CASE WE RECIEVE AN ERROR
   };

  useEffect(() => {
    getPostsData();
   }, [])


  return (
    <div style={{ maxWidth: '600px', marginLeft: 'auto', marginRight: 'auto'}}>
      {
        data && data.map(d =>
          <Post title={d.title} body={d.body} comments={d.comments} id={d.id} key={d.id} />
        )
      }

      <NewPost getPostsFunc={getPostsData} />
    </div>
  )

}


export default Feed;
